  definition: dispositif permettant le branchement de l'installation de l'usager à
    une ligne d'usager, ou directement sur une ligne de distribution
  examples: []
  notes:
  - Une prise d'usager peut comporter plusieurs sorties.
  - Une prise d'usager peut comporter des organes, tels que filtre ou sélecteur de
    programme.
